import './App.css';

const person = {
  name:  <h1>Adrian Zurawski</h1>,
  age:   <h2>20</h2>,
  email: <h2>adrianzurawskiii@gmail.com</h2>
}

function App() {
  return (
    <div className="App">
      <User />
    </div>
  );
}
const User = () => {
  return(
    <div>
      <h1>Adrian</h1>
      <h2>20</h2>
      <h2>adrian@adrian.com</h2>    
    </div>
  );
}
export default App;
